[package.metadata]
requires-dist = [
    { name = "gitdb", specifier = ">=4" },
    { name = "gitpython", specifier = ">=3" },
    { name = "mercurial", marker = "extra == 'hg'" },
    { name = "p4python", marker = "extra == 'p4'" },
]
provides-extras = ["hg", "p4"]

[package.metadata.requires-dev]
dev = [
    { name = "pre-commit", specifier = "<3.6" },
    { name = "pytest", specifier = ">=6.2.4" },
    { name = "pytest-cov", specifier = ">=2.12.1" },
    { name = "pytest-randomly", specifier = ">=3.10.1" },
    { name = "ruff", specifier = ">=0.12.7" },
]

